import React from "react";

const Square = (props) => {
  return (
    <div
      onClick={props.onClick}
      style={{
        border: "1px solid",
        height: "100%",
        width: "60",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        fontWeight: "bold",
        font:"60px sans-serif",
      }}
      className="square"
    >
      <h5>{props.value}</h5>
    </div>
  );
};

export default Square;
